const Address_model=require("../models/address_model"),auth_helper=require("../helpers/auth_helper");exports.get=function(e,t,s){Address_model.get(e.query.options.user_id,null,function(e){s(e)})},exports.create=function(e,t,s){Address_model.create(e.body.user_id,e.body,function(t){auth_helper.check_session(e,e.body.user_id,function(){s(t)})})},exports.update=function(e,t,s){Address_model.update(e.body.options.user_id,e.body.address_id,e.body,function(t){auth_helper.check_session(e,e.body.options.user_id,function(){t.updated_token=e.query.updated_token,s(t)})})},exports["delete"]=function(e,t){Address_model["delete"](e.body.options.user_id,e.body.address_id,function(s){auth_helper.check_session(e,e.body.options.user_id,function(){s.updated_token=e.query.updated_token,t(s)})})};